// src/components/AccountForm.jsx
import { useMutation } from "@apollo/client";
import { useState } from "react";
import { SAVE_COMPTE } from "../graphql/mutations";
import { GET_ALL_COMPTES } from "../graphql/queries";

function AccountForm() {
  const [formData, setFormData] = useState({
    solde: "",
    type: "COURANT",
    dateCreation: new Date().toISOString().split("T")[0],
  });

  const [saveCompte, { loading }] = useMutation(SAVE_COMPTE, {
    refetchQueries: [{ query: GET_ALL_COMPTES }],
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const date = new Date(formData.dateCreation);
      const jour = String(date.getDate()).padStart(2, "0");
      const mois = String(date.getMonth() + 1).padStart(2, "0");
      const annee = date.getFullYear();
      const formattedDate = `${jour}/${mois}/${annee}`;

      await saveCompte({
        variables: {
          compte: {
            solde: parseFloat(formData.solde),
            type: formData.type,
            dateCreation: formattedDate,
          },
        },
      });

      setFormData({
        solde: "",
        type: "COURANT",
        dateCreation: new Date().toISOString().split("T")[0],
      });
    } catch (error) {
      console.error("Erreur:", error);
    }
  };

  return (
    <div className="bg-gradient-to-b from-purple-800 to-purple-900 rounded-xl shadow-2xl p-8">
      <h2 className="text-2xl text-white font-bold mb-8 text-center">
        Nouveau Compte
      </h2>

      <form onSubmit={handleSubmit} className="space-y-6">
        <div className="relative">
          <input
            type="number"
            step="0.01"
            required
            value={formData.solde}
            onChange={(e) =>
              setFormData({ ...formData, solde: e.target.value })
            }
            className="w-full bg-purple-950/50 text-white px-4 py-3 rounded-lg 
                     focus:outline-none focus:ring-2 focus:ring-purple-400
                     placeholder-purple-300 backdrop-blur-sm"
            placeholder="Solde initial"
          />
          <span className="absolute right-4 top-3 text-purple-300">DH</span>
        </div>

        <div className="relative group">
          <select
            required
            value={formData.type}
            onChange={(e) => setFormData({ ...formData, type: e.target.value })}
            className="w-full bg-purple-950/50 text-white px-4 py-3 rounded-lg
                     appearance-none cursor-pointer focus:outline-none 
                     focus:ring-2 focus:ring-purple-400 backdrop-blur-sm"
          >
            <option value="COURANT" className="bg-purple-900">
              Compte Courant
            </option>
            <option value="EPARGNE" className="bg-purple-900">
              Compte Épargne
            </option>
          </select>
          <div
            className="absolute right-4 top-4 text-purple-300 pointer-events-none
                        group-hover:transform group-hover:-translate-y-0.5 transition-transform"
          >
            ▼
          </div>
        </div>

        <div>
          <input
            type="date"
            required
            value={formData.dateCreation}
            onChange={(e) =>
              setFormData({ ...formData, dateCreation: e.target.value })
            }
            className="w-full bg-purple-950/50 text-white px-4 py-3 rounded-lg
                     focus:outline-none focus:ring-2 focus:ring-purple-400
                     backdrop-blur-sm"
            max={new Date().toISOString().split("T")[0]}
          />
        </div>

        <button
          type="submit"
          disabled={loading}
          className={`w-full py-4 rounded-lg text-lg font-semibold transition-all
                     transform hover:scale-[1.02] active:scale-[0.98] duration-200
                     ${
                       loading
                         ? "bg-purple-400 cursor-not-allowed"
                         : "bg-gradient-to-r from-purple-400 to-fuchsia-500 hover:shadow-lg"
                     }`}
        >
          {loading ? (
            <div className="flex items-center justify-center space-x-2">
              <div className="w-4 h-4 border-2 border-white border-t-transparent rounded-full animate-spin" />
              <span>Création en cours...</span>
            </div>
          ) : (
            "Créer le compte"
          )}
        </button>
      </form>

      {/* Animation d'arrière-plan */}
      <div
        className="absolute inset-0 -z-10 overflow-hidden blur-3xl"
        aria-hidden="true"
      >
        <div
          className="relative left-[calc(50%-11rem)] aspect-[1155/678] w-[36.125rem] 
                      -translate-x-1/2 rotate-[30deg] bg-gradient-to-tr from-purple-400 
                      to-fuchsia-500 opacity-20 sm:left-[calc(50%-30rem)] sm:w-[72.1875rem]"
        />
      </div>
    </div>
  );
}

export default AccountForm;
